import React from 'react';
import './App.css';
import Header from './components/Header';

const App = () => {
    return (
        <div className='app-wrapper'>
            <Header/>
            <nav className='nav'>
                <div><a>Profile</a></div>
                <div><a>Messages</a></div>
                <div><a>News</a></div>
                <div><a>Music</a></div>
                <div><a>Settings</a></div>
            </nav>
            <div className='content'>
                <div>
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTT-_mIfmXfxZydIr5sSyiVu6p_LMiG6L8ZDw&usqp=CAU" />
                </div>
                <div>

                </div>

            </div>
        </div>
    );
}

export default App;
